import React, { useState } from 'react';
import { BrowserRouter as Router, Route, Routes, Link, useNavigate } from 'react-router-dom'; // Import necessary Router components
import ProductList from './Product/ProductLIst';
import ProductCreation from './Product/ProductCreation';
import ProductDetail from './Product/ProductDetail';


// Dummy Data
const dummyCars = [
    { id: 1, title: 'Tesla Model S', imageUrl: 'https://via.placeholder.com/400x250', description: 'Electric sedan with autopilot.' },
    { id: 2, title: 'Ford Mustang', imageUrl: 'https://via.placeholder.com/400x250', description: 'Classic muscle car with a powerful engine.' },
    { id: 3, title: 'Toyota Supra', imageUrl: 'https://via.placeholder.com/400x250', description: 'Sports car known for its speed.' },
];

const App = () => {

    return (
        <Router>
            <div>
                <nav>
                    <Link to="/" style={{ margin: '10px' }}>Home</Link>
                    <Link to="/create" style={{ margin: '10px' }}>Create Car</Link>
                </nav>

                <Routes>
                    <Route 
                        path="/" 
                        element={<ProductList />}
                    />
                    <Route 
                        path="/create" 
                        element={<ProductCreation />}
                    />

                    <Route 
                        path="/product/:id" 
                        element={<ProductDetail />}
                    />
                </Routes>
            </div>
        </Router>
    );
};

export default App;
